// src/pages/StudentDashboard.js
import React, { useState } from "react";
import Layout from "../components/Layout";
import "./StudentDashboard.css"; // make sure this CSS file exists

export default function StudentDashboard() {
  const [activeMenu, setActiveMenu] = useState("Dashboard");

  // Example data (replace with backend API)
  const notices = [
    { id: 1, title: "Project Submission", content: "Project submission next week", date: "2025-12-15" },
    { id: 2, title: "DBMS Quiz", content: "Quiz on Monday", date: "2025-12-13" },
  ];

  const timetable = [
    { day: "Monday", subject: "DBMS" },
    { day: "Tuesday", subject: "AI" },
  ];

  return (
    <Layout>
      <div className="dashboard-container">

        {/* Sidebar */}
        <aside className="sidebar">
          <div className="profile-section">
            <img
              src="/images/student-profile.jpg" // replace with dynamic student photo
              alt="Profile"
              className="profile-img"
            />
            <h3>John Doe</h3>
            <p>Roll No: 12345</p>
          </div>

          <div className="menu">
            {["Dashboard", "Profile", "Mark Attendance", "Logout"].map((menu) => (
              <button
                key={menu}
                className={activeMenu === menu ? "active" : ""}
                onClick={() => setActiveMenu(menu)}
              >
                {menu}
              </button>
            ))}
          </div>
        </aside>

        {/* Main Content */}
        <section className="content">
          {activeMenu === "Dashboard" && (
            <div className="dashboard-view">
              {/* Notice Board */}
              <div className="notice-board">
                <h2>Notice Board</h2>
                {notices.map((notice) => (
                  <div className="card" key={notice.id}>
                    <h4>{notice.title}</h4>
                    <p>{notice.content}</p>
                    <small>{notice.date}</small>
                  </div>
                ))}
              </div>

              {/* Timetable */}
              <div className="timetable">
                <h2>Timetable</h2>
                <table>
                  <thead>
                    <tr>
                      <th>Day</th>
                      <th>Subject</th>
                    </tr>
                  </thead>
                  <tbody>
                    {timetable.map((item, index) => (
                      <tr key={index}>
                        <td>{item.day}</td>
                        <td>{item.subject}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          )}

          {activeMenu === "Profile" && (
            <div className="profile-card">
              <h2>Profile</h2>
              <p><strong>Name:</strong> John Doe</p>
              <p><strong>Roll No:</strong> 12345</p>
              <p><strong>Semester:</strong> 4th</p>
              <p><strong>Email:</strong> john@example.com</p>
            </div>
          )}

          {activeMenu === "Mark Attendance" && (
            <div className="attendance-card">
              <h2>Mark Attendance</h2>
              <video className="camera" autoPlay></video>
              <button className="capture-btn">Capture & Mark</button>
            </div>
          )}

          {activeMenu === "Logout" && (
            <div className="profile-card">
              <h2>Logging out...</h2>
            </div>
          )}
        </section>
      </div>
    </Layout>
  );
}
